import React from 'react';
import "../style.css";
import PhipsonSVG from '../PhipsonSVG';

const pageIDStyle = ["Mixed-Reality Developer","HCI Researcher","Software Engineer"]

class LandingPage extends React.Component {

    componentDidMount() {
        this.props.onRef(this);
    }

    // Uses the onStateChange function passed from App.js to change pages
    render() { 
      return (
            <div className="LandingWrapper">
                <div className="LandingText">
                    <h1>Hello, I'm Phipson</h1>
                    <div className="LandingInteractionWrapper">
                        <p className="LandingInteractionText">I'm a </p>
                        <div>
                            <button className="LandingInteractionButton"
                                    onClick={() => this.props.onChange(this.props.pageID-1)}>&lt;</button>
                            <p className="LandingInteractionText">{pageIDStyle[this.props.pageID]}</p>
                            <button className="LandingInteractionButton" 
                                    onClick={() => this.props.onChange(this.props.pageID+1)}>&gt;</button>
                        </div>
                    </div>
                    <button className="LandingNavigationButton">Browse Work &#8594;</button>
                </div>
                <div className="LandingSVG">
                    <PhipsonSVG pageID={this.props.pageID} onRef={ref => (this.child = ref)}/>
                </div>
            </div>
        );
    }
}

export default LandingPage;
